import React from "react";

// reactstrap components
import {
  Col,
  Row,
  Card,
  CardTitle,
  CardHeader,
  CardBody,
  CardFooter,
  Button
} from "reactstrap";



class Start extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      modalClassic: false,
    };
  }
  toggleModalClassic = () => {
    this.setState({
      modalClassic: !this.state.modalClassic
    });
  };
  render() {
    return (
      <>
        <div className="content start">
          <Row>
            <Col className="ml-auto mr-auto mt-5" md="7">
              <Card className="card-plain text-center">
                <CardHeader>
                  <CardTitle className="p-0" tag="h1">PIETER LEMS</CardTitle>
                </CardHeader>
                <CardBody className="p-0">
                  <img style={{ width: '40px'}} alt="..." src={require("assets/img/logo.png")} />
                  <h3 className="mt-2" style={{ fontWeight: '200' }}>Computer Science student at the university of Applied Sciences, Freelance Website & Web application developer, Freelance security consultant.</h3>
                </CardBody>
                <CardFooter>
                  <div className="button-container">
                    <Button className="btn" color="primary" onClick={this.toggleModalNotice}>
                      <i className="tim-icons icon-badge mb-1" /> &nbsp; Resume
                    </Button>
                    <embed src="https://pieterlems.github.io/Downloadable-Files/Pieter_Lems_Resume.pdf" className="frame" />
                    <Button className="btn" color="primary" href="https://github.com/PieterLems">
                      <i className="fab fa-github" /> &nbsp; Github
                    </Button>
                  </div>
                </CardFooter>
              </Card>
            </Col>
          </Row>
        </div>
      </>
    );
  }
}

export default Start;
